import React from 'react'
import { Box, Stack } from '@mui/system'
import { Link } from 'react-router-dom'
import { makeStyles } from '@material-ui/styles';

const useStyle = makeStyles({
  Link: {
    textDecoration: 'none',
    color:'white',
    fontSize:'14px',
    textShadow:'rgb(0 0 0 / 25%) 0px 1px 2px',
    padding:'8px',
    fontWeight:'bold'
    
  },
})
const StackItem = () => {
  const stackstyle= useStyle();
  return (
    <>
    <Box pt={4}>
    <Stack direction="row" spacing={2} justifyContent="center"
       alignItems="center">
         <Link to='/buy'  className={stackstyle.Link}>Buy</Link>
         <Link to='/rent' className={stackstyle.Link}>Rent</Link>
         <Link to='/project' className={stackstyle.Link}>Project</Link>
         <Link to='/product' className={stackstyle.Link}>Product</Link>
         <Link to='/architect' className={stackstyle.Link}>Architect</Link>
      </Stack>
    </Box>
      
    </>
  )
}

export default StackItem
